import React from "react";

const Institutions = () => {
  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold text-gray-800 amiri-font mb-6">
        المؤسسات والجهات
      </h1>
      <p className="text-gray-600">صفحة المؤسسات والجهات قيد التطوير...</p>
    </div>
  );
};

export default Institutions;
